import React from 'react';
import '../styles/Research.css';

const Research = () => {
  return (
    <div className="research-page">
      {/* Mission Statement Section */}
      <div className="mission-section">
        <h1>Pioneering Research on Autonomous Intelligence</h1>
        <p>
          Our research aims to push the boundaries of AI technology, leading to fully autonomous systems capable of solving complex, human-level problems. Autonomy Labs is committed to creating safe, scalable, and efficient AGI solutions that will revolutionize industries.
        </p>
        <div className="mission-buttons">
          <button className="view-research-button">View research index</button>
          <button className="learn-more-button">Learn about safety</button>
        </div>
      </div>
    </div>
  );
};

export default Research;
